        static BigInteger maximumExperience(int[] h)
        {
            BigInteger sum = 0;

            foreach (int vl in h)
            {
                sum += vl;
            }

            var x = h.ToList();
            x.Sort();
          
            int s = 1;
            BigInteger max = 0;
            BigInteger current = 0;
            max = s * sum;

            foreach (int vl in x)
            {
                sum -= vl;
                s++;
                current = s * sum;

                if (current < max)
                    return max;
                else
                    max = current;
            }

            return max;
